import React, { useEffect, useState } from 'react';
import axios from 'axios';
import styles from './styles/Dashboard.module.css';

const Dashboard = () => {
  const [email, setEmail] = useState('');
  const [feedbacksByDate, setFeedbacksByDate] = useState({});
  const [message, setMessage] = useState('');
  const [link, setLink] = useState('');

  useEffect(() => {
    const storedEmail = localStorage.getItem('email');
    if (storedEmail) {
      setEmail(storedEmail);
      fetchFeedback(storedEmail);
    } else {
      setMessage('No logged-in user. Please log in.');
    }
  }, []);

  const fetchFeedback = async (emailToFetch) => {
    try {
      const response = await axios.get(`http://localhost:5000/api/feedback/${emailToFetch}`);
      const grouped = groupByDate(response.data);
      setFeedbacksByDate(grouped);
      setMessage('Feedbacks loaded successfully');
      setLink(`http://localhost:3000/send-feedback?email=${encodeURIComponent(emailToFetch)}`);
    } catch (error) {
      setMessage(error.response?.data?.message || 'Failed to load feedbacks');
    }
  };

  const groupByDate = (feedbacks) => {
    return feedbacks.reduce((acc, fb) => {
      const date = new Date(fb.createdAt).toLocaleDateString('en-CA'); // Format: YYYY-MM-DD
      if (!acc[date]) acc[date] = [];
      acc[date].push(fb);
      return acc;
    }, {});
  };

  const handleCopy = () => {
    navigator.clipboard.writeText(link).then(() => {
      alert('Inbox URL copied!');
    });
  };

  return (
    <div className={styles.container}>
      <div className={styles.header}>
        <h1 className={styles.title}>Incognito Inbox</h1>
      </div>

      <div className={styles.content}>
        <div className={styles.boxContainer}>
          <div className={styles.box}>
            <h3 className={styles.boxTitle}>Your Inbox Link</h3>
            <div className={styles.linkContainer}>
              <code className={styles.linkCode}>{link}</code>
              <button onClick={handleCopy} className={styles.copyButton}>Copy</button>
            </div>
          </div>

          <div className={styles.box}>
            <h3 className={styles.boxTitle}>Feedback Received</h3>
            {message && <p className={styles.message}>{message}</p>}
            <div className={styles.feedbackContainer}>
              {Object.keys(feedbacksByDate).length === 0 ? (
                <p className={styles.noFeedback}>No feedback yet.</p>
              ) : (
                Object.entries(feedbacksByDate).map(([date, feedbacks]) => (
                  <details key={date} open className={styles.feedbackGroup}>
                    <summary className={styles.feedbackDate}>{date}</summary>
                    <ul className={styles.feedbackList}>
                      {feedbacks.map((fb) => (
                        <li key={fb._id} className={styles.feedbackItem}>
                          <p><strong>{fb.subject || 'No Subject'}</strong></p>
                          <p>{fb.message}</p>
                          <small className={styles.timestamp}>
                            {new Date(fb.createdAt).toLocaleTimeString()}
                          </small>
                        </li>
                      ))}
                    </ul>
                  </details>
                ))
              )}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
